webpackJsonp([0x71f0e62a1ca8],{684:function(e,o){e.exports={data:{site:{siteMetadata:{title:"Kostas Bariotis' Blog",description:"I am Kostas Bariotis, a web developer, a proud wanderer and a passionate doer. My mission is to write clean and efficient code, to solve problems on the web and to learn something more.",siteUrl:"https://kostasbariotis.com"}}},pathContext:{posts:[{excerpt:"I am certainly not a SEO expert. Neverthless, I am developing web sites and I have to be able to deliver after all a SEO optimized web site. Take a SEO Check Up Check your site using  SEO Site Checkup , which will be able to report you how your siteâ€¦",html:'<p>I am certainly not a SEO expert. Neverthless, I am developing web sites and I have to be able to deliver after all a SEO optimized web site.</p>\n<h2 id="take-a-seo-check-up"><a href="#take-a-seo-check-up" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Take a SEO Check Up</h2>\n<p>Check your site using <a href="http://seositecheckup.com/" target="_blank" rel="noreferrer noopener">SEO Site Checkup</a>, which will be able to report you how your site is doing in terms of SEO best practices. Try to keep your total score above 80%-90%.</p>\n<h2 id="keep-google-satisfied"><a href="#keep-google-satisfied" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Keep Google Satisfied</h2>\n<p>Follow <a href="https://support.google.com/webmasters/answer/35291?hl=en" target="_blank" rel="noreferrer noopener">Google\'s best practices</a> and do not forget to implement <a href="https://support.google.com/webmasters/answer/99170?hl=en" target="_blank" rel="noreferrer noopener">Rich Snippets</a> to let Google\'s search algorithms better understand you.</p>\n<h2 id="monitor-your-seo-route"><a href="#monitor-your-seo-route" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Monitor your SEO route</h2>\n<p>Use <a href="http://www.audiencebloom.com/2014/08/15-tools-love-monitor-seo-progress/" target="_blank" rel="noreferrer noopener">a tool</a> in order to monitor how you are doing on Page Rank and try to find patterns that works for you or even the patterns that is damaging your image and eliminate them.</p>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>Of course, the SEO success is a result that depends on a lot of factors and it\'s certainly not an one man show.\nAt the end, there is not really an excuse for a Web Developer to not be able to deliver a finest SEO optimized web site.</p>',id:"/home/travis/build/kbariotis/kostasbariotis.com/blog/how-to-keep-up-on-seo/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2015-01-26T19:35:21.000Z",path:"/how-to-keep-up-on-seo/",tags:"seo, google, pagerank",title:"How to keep up on SEO",draft:null}}],tag:"pagerank",pagesSum:1,page:1}}}});
